sys_variable_value.value:
(function execute(inputs, outputs) {
var rawResponse = inputs.json2clean;

    try {
        // First, parse the outer JSON to get the string inside `model_output`
        var parsedResponse = JSON.parse(rawResponse);

        // Then, parse the `model_output` field which is still a stringified JSON
        var cleanedJSON = JSON.parse(parsedResponse.model_output);

        // Store the properly formatted JSON
        outputs.cleanjson = JSON.stringify(cleanedJSON);
    } catch (e) {
        outputs.cleanjson = "Error: " + e;
    }
outputs.card2play = cleanedJSON.card_selected;
outputs.location2play = cleanedJSON.location_selected;
outputs.rationale = cleanedJSON.rationale;
outputs.endturn = cleanedJSON.end_turn;

})(inputs, outputs);

