sys_variable_value.value:
(function execute(inputs, outputs) {
var gameInstanceId = inputs.game_instance_id;
//var gameInstanceId = "410a2c056d9c22107f448d5f282fc3d0";  // debug ID for development
try {
	var suggestionResult = new x_168987_flow_de_0.SinglePlayerAISuggestion().suggestionFromGameInstance(gameInstanceId);

	outputs.response_payload = suggestionResult;
}
catch (e) {
	outputs.response_payload = 'Something went wrong while executing skill. game instance : '+inputs.game_instance_id+ " and Error: "+e;
}

})(inputs, outputs);

